import { RoomContext } from '../context';
import Loading from './Loading';
import Room from './Room';

export default class extends Component {
	static contextType = RoomContext;
	render() {
		const { featuredRooms: rooms } = this.context;
		console.log(rooms);
		return (
			<div>
				<div>
					from featured rooms
					<Room />
					<Loading />
				</div>
			</div>
		);
	}
}
